class Form extends Component {

  handleChange(e) {
    e.preventDefault()
    let input = e.target.value
    this.setState(prevState => ({
      input: input
    }))
    console.log(this.props.input)
  }

  handleSubmit(input, e) {
    e.preventDefault()
    console.log(this.props.input)
  }

  render() {
    return(
      <form
      className="input"
      onSubmit={(e) => this.handleSubmit(this.props.input, e)}
      >
      <input
      placeholder="Whatcha Thinkin?"
      onChange={(e) => this.handleChange(this.props.input, e)}
       />
      <button>Click Here</button>
      </form>
      )
  }
}

export default Form
